import React from "react";

// import "./Title3.css";
import Particles from "react-particles-js";

const title = props => {
  return (
    <Particles
      params={{
        particles: {
          number: {
            value: 50
          },
          size: {
            value: 3
          }
        },
        interactivity: {
          events: {
            onhover: {
              enable: true,
              mode: "repulse"
            }
          }
        }
      }}
    />
  );
};

export default title;
